import React from "react";
import { Route } from "react-router-dom";
import Hoc from "./hoc/hoc";

// import Login from "./containers/Login";
import Login from "./components/Auth/Login";
// import Signup from "./containers/Signup";
import Signup from "./components/Auth/Signup";
import HomepageLayout from "./containers/Home";
import ProductList from "./containers/ProductList";
import ProductDetail from "./containers/ProductDetail";
// import ShopList from "./containers/ShopList";
import ShopList from "./components/ShopList/ShopList";
// import ShopProductList from "./containers/ShopProductList";
import ShopProductList from "./components/ProductList/ProductList";
import OrderSummary from "./containers/OrderSummary";
// import Checkout from "./containers/Checkout";
import CheckoutForm from "./components/OrderSummary/OrderSummary";
import Profile from "./containers/Profile";
import Dashboard from "./containers/Dashboard";

const BaseRouter = () => (
  <Hoc>
    <Route exact path="/products" component={ProductList} />
    <Route path="/products/:productID" component={ProductDetail} />
    <Route exact path="/shops" component={ShopList} />
    <Route path="/shops/:shopID" component={ShopProductList} />
    <Route path="/login" component={Login} />
    <Route path="/signup" component={Signup} />
    <Route path="/order-summary" component={OrderSummary} />
    <Route path="/checkout" component={Checkout} />
    <Route path="/profile" component={Profile} />
    <Route path="/dashboard" component={Dashboard} />
    {/* <Route exact path="/" component={HomepageLayout} /> */}
    <Route exact path="/" component={ShopList} />
  </Hoc>
);
export default BaseRouter;
